import GalleryItem from "../";

function GalleryList({ galleryItems }) {
  console.log('gallery items', galleryItems)
  return (
    <section>
      {galleryItems.map((item) => (
        <GalleryItem 
        key={item.id}
        item={item}
        likes={item.likes}
        />
      ))}
    </section>
  )
} 

export default GalleryList;
